INSERT INTO `app_questions` VALUES (19,0,'What is the common unit of measurement for energy data?','KW/h'),(34,0,'In the days before electric light, how did the owners of factories and mills provide enough light for the workers?','They built the mills and factories with very large windows and put the machines near the windows.The buildings would have large south-facing windows. Fires and candles would provide a fire-risk.'),(33,0,'You used to spend around £15 a month on lighting. You have now replaced all your light bulbs with low-energy compact fluorescent bulbs. How much will you save every year?','Around £120.00'),(30,0,'How does a Compact Fluorescent bulb work?','By warming a gas up inside a tube, which then glows.'),(31,0,'Which is the most energy efficient light bulb?','Thin fluorescent bulbs.'),(29,0,'Why does an incandescent bulb cost more to run?','Because so much of the energy used by this type of bulb goes into heat (not light) so it uses lots of energy to give us enough light.');
